@testset "1.2.2.2 (d x)^m (a+b x^2+c x^4)^p" begin
    @variables a, b, c, d, m, p, x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(a+b*x^2+c*x^4)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(a+b*x^2+c*x^4)^p*with*b^2-4*a*c=0=#


    #= ::Subsection:: =#
    #=Integrands*of*the*form*(a^2+2*a*b*x^2+b^2*x^4)^p=#


    #= ::Subsection:: =#
    #=Integrands*of*the*form*(a^2+2*a*b*x^2+b^2*x^4)^(p/2)=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(a^2+2*a*b*x^2+b^2*x^4)^(p/4)=#


    @test_int [(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4), x, 4, (1/4)*x*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4) + (3*a*x*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4))/(8*(a + b*x^2)) + (3*sqrt(a)*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4)*asinh((sqrt(b)*x)/sqrt(a)))/(8*sqrt(b)*(1 + (b*x^2)/a)^(3/2))]
    @test_int [(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4), x, 3, (1/2)*x*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4) + (sqrt(a)*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)*asinh((sqrt(b)*x)/sqrt(a)))/(2*sqrt(b)*sqrt(1 + (b*x^2)/a))]
    @test_int [1/(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4), x, 2, (sqrt(a)*sqrt(1 + (b*x^2)/a)*asinh((sqrt(b)*x)/sqrt(a)))/(sqrt(b)*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4))]
    @test_int [1/(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4), x, 2, (x*(a + b*x^2))/(a*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4))]
    @test_int [1/(a^2 + 2*a*b*x^2 + b^2*x^4)^(5/4), x, 3, (x*(a + b*x^2))/(3*a*(a^2 + 2*a*b*x^2 + b^2*x^4)^(5/4)) + (2*x)/(3*a^2*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)), (2*x)/(3*a^2*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)) + x/(3*a*(a + b*x^2)*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4))]
    @test_int [1/(a^2 + 2*a*b*x^2 + b^2*x^4)^(7/4), x, 4, (x*(a + b*x^2))/(5*a*(a^2 + 2*a*b*x^2 + b^2*x^4)^(7/4)) + (4*x)/(15*a^2*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4)) + (8*x*(a + b*x^2))/(15*a^3*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4)), (4*x)/(15*a^2*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4)) + x/(5*a*(a + b*x^2)*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4)) + (8*x*(a + b*x^2))/(15*a^3*(a^2 + 2*a*b*x^2 + b^2*x^4)^(3/4))]
    @test_int [1/(a^2 + 2*a*b*x^2 + b^2*x^4)^(9/4), x, 5, (x*(a + b*x^2))/(7*a*(a^2 + 2*a*b*x^2 + b^2*x^4)^(9/4)) + (6*x)/(35*a^2*(a^2 + 2*a*b*x^2 + b^2*x^4)^(5/4)) + (8*x*(a + b*x^2))/(35*a^3*(a^2 + 2*a*b*x^2 + b^2*x^4)^(5/4)) + (16*x)/(35*a^4*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)), (16*x)/(35*a^4*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)) + x/(7*a*(a + b*x^2)^3*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)) + (6*x)/(35*a^2*(a + b*x^2)^2*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4)) + (8*x)/(35*a^3*(a + b*x^2)*(a^2 + 2*a*b*x^2 + b^2*x^4)^(1/4))]


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(a+b*x^2+c*x^4)^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(a+b*x^2+c*x^4)^p=#


    @test_int [1/(a^2 + b + 2*a*x^2 + x^4), x, 9, -(atan((sqrt(-a + sqrt(a^2 + b)) - sqrt(2)*x)/sqrt(a + sqrt(a^2 + b)))/(2*sqrt(2)*sqrt(a^2 + b)*sqrt(a + sqrt(a^2 + b)))) + atan((sqrt(-a + sqrt(a^2 + b)) + sqrt(2)*x)/sqrt(a + sqrt(a^2 + b)))/(2*sqrt(2)*sqrt(a^2 + b)*sqrt(a + sqrt(a^2 + b))) - log(sqrt(a^2 + b) - sqrt(2)*sqrt(-a + sqrt(a^2 + b))*x + x^2)/(4*sqrt(2)*sqrt(a^2 + b)*sqrt(-a + sqrt(a^2 + b))) + log(sqrt(a^2 + b) + sqrt(2)*sqrt(-a + sqrt(a^2 + b))*x + x^2)/(4*sqrt(2)*sqrt(a^2 + b)*sqrt(-a + sqrt(a^2 + b)))]
    @test_int [1/(-1 + a^2 + 2*a*x^2 + x^4), x, 3, -(atan(x/sqrt(1 + a))/(2*sqrt(1 + a))) - atanh(x/sqrt(1 - a))/(2*sqrt(1 - a))]
    #= Tests*that*NegativeQ(b^2-4*a*c)*returns*True*to*avoid*im*in*antiderivative! =#
    @test_int [1/(1 + a^2 + 2*a*x^2 + x^4), x, 9, -(atan((sqrt(-a + sqrt(1 + a^2)) - sqrt(2)*x)/sqrt(a + sqrt(1 + a^2)))/(2*sqrt(2)*sqrt(1 + a^2)*sqrt(a + sqrt(1 + a^2)))) + atan((sqrt(-a + sqrt(1 + a^2)) + sqrt(2)*x)/sqrt(a + sqrt(1 + a^2)))/(2*sqrt(2)*sqrt(1 + a^2)*sqrt(a + sqrt(1 + a^2))) - log(sqrt(1 + a^2) - sqrt(2)*sqrt(-a + sqrt(1 + a^2))*x + x^2)/(4*sqrt(2)*sqrt(1 + a^2)*sqrt(-a + sqrt(1 + a^2))) + log(sqrt(1 + a^2) + sqrt(2)*sqrt(-a + sqrt(1 + a^2))*x + x^2)/(4*sqrt(2)*sqrt(1 + a^2)*sqrt(-a + sqrt(1 + a^2)))]

    @test_int [1/(4 - 5*x^2 + x^4), x, 3, (-(1/6))*atanh(x/2) + atanh(x)/3]
    @test_int [1/(3 + 4*x^2 + x^4), x, 3, atan(x)/2 - atan(x/sqrt(3))/(2*sqrt(3))]
    @test_int [1/(9 + 5*x^2 + x^4), x, 9, -(atan((1 - 2*x)/sqrt(11))/(6*sqrt(11))) + atan((1 + 2*x)/sqrt(11))/(6*sqrt(11)) - (1/12)*log(3 - x + x^2) + (1/12)*log(3 + x + x^2)]
    @test_int [1/(1 - x^2 + x^4), x, 9, (-(1/2))*atan(sqrt(3) - 2*x) + (1/2)*atan(sqrt(3) + 2*x) - log(1 - sqrt(3)*x + x^2)/(4*sqrt(3)) + log(1 + sqrt(3)*x + x^2)/(4*sqrt(3))]
    @test_int [1/(2 + 2*x^2 + x^4), x, 9, (-(1/4))*sqrt(-1 + sqrt(2))*atan((sqrt(2*(-1 + sqrt(2))) - 2*x)/sqrt(2*(1 + sqrt(2)))) + (1/4)*sqrt(-1 + sqrt(2))*atan((sqrt(2*(-1 + sqrt(2))) + 2*x)/sqrt(2*(1 + sqrt(2)))) - log(sqrt(2) - sqrt(2*(-1 + sqrt(2)))*x + x^2)/(8*sqrt(-1 + sqrt(2))) + log(sqrt(2) + sqrt(2*(-1 + sqrt(2)))*x + x^2)/(8*sqrt(-1 + sqrt(2)))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(a+b*x^2+c*x^4)^(p/2)=#


    #= ::Subsubsection:: =#
    #=p>0=#


    #= ::Subsubsection::Closed:: =#
    #=p<0=#


    @test_int [1/sqrt(2 + 5*x^2 - 3*x^4), x, 2, EllipticF(asin(x/sqrt(2)), -6)]
    @test_int [1/sqrt(2 + 4*x^2 - 3*x^4), x, 2, sqrt((1/6)*(2 + sqrt(10)))*EllipticF(asin(sqrt((1/2)*(-2 + sqrt(10)))*x), (1/3)*(-7 - 2*sqrt(10)))]
    @test_int [1/sqrt(2 + 3*x^2 - 3*x^4), x, 2, sqrt(2/(-3 + sqrt(33)))*EllipticF(asin(sqrt(6/(3 + sqrt(33)))*x), (1/4)*(-7 - sqrt(33)))]
    @test_int [1/sqrt(2 + 2*x^2 - 3*x^4), x, 2, EllipticF(asin(sqrt(3/(1 + sqrt(7)))*x), (1/3)*(-4 - sqrt(7)))/sqrt(-1 + sqrt(7))]
    @test_int [1/sqrt(2 + 1*x^2 - 3*x^4), x, 2, EllipticF(asin(x), -(3/2))/sqrt(2)]
    @test_int [1/sqrt(2 + 0*x^2 - 3*x^4), x, 1, EllipticF(asin((3/2)^(1/4)*x), -1)/6^(1/4)]
    @test_int [1/sqrt(2 - 1*x^2 - 3*x^4), x, 2, EllipticF(asin(sqrt(3/2)*x), -(2/3))/sqrt(3)]
    @test_int [1/sqrt(2 - 2*x^2 - 3*x^4), x, 2, EllipticF(asin(sqrt(3/(-1 + sqrt(7)))*x), (1/3)*(-4 + sqrt(7)))/sqrt(1 + sqrt(7))]
    @test_int [1/sqrt(2 - 3*x^2 - 3*x^4), x, 2, sqrt(2/(3 + sqrt(33)))*EllipticF(asin(sqrt(6/(-3 + sqrt(33)))*x), (1/4)*(-7 + sqrt(33)))]
    @test_int [1/sqrt(2 - 4*x^2 - 3*x^4), x, 2, sqrt((1/6)*(-2 + sqrt(10)))*EllipticF(asin(sqrt((1/2)*(2 + sqrt(10)))*x), (1/3)*(-7 + 2*sqrt(10)))]
    @test_int [1/sqrt(2 - 5*x^2 - 3*x^4), x, 2, EllipticF(asin(sqrt(3)*x), -(1/6))/sqrt(6)]


    @test_int [1/sqrt(3 + 7*x^2 - 2*x^4), x, 2, sqrt(2/(-7 + sqrt(73)))*EllipticF(asin((2*x)/sqrt(7 + sqrt(73))), (1/12)*(-61 - 7*sqrt(73)))]
    @test_int [1/sqrt(3 + 6*x^2 - 2*x^4), x, 2, sqrt((1/6)*(3 + sqrt(15)))*EllipticF(asin(sqrt((1/3)*(-3 + sqrt(15)))*x), -4 - sqrt(15))]
    @test_int [1/sqrt(3 + 5*x^2 - 2*x^4), x, 2, EllipticF(asin(x/sqrt(3)), -6)]
    @test_int [1/sqrt(3 + 4*x^2 - 2*x^4), x, 2, EllipticF(asin(sqrt(2/(2 + sqrt(10)))*x), (1/3)*(-7 - 2*sqrt(10)))/sqrt(-2 + sqrt(10))]
    @test_int [1/sqrt(3 + 3*x^2 - 2*x^4), x, 2, sqrt(2/(-3 + sqrt(33)))*EllipticF(asin((2*x)/sqrt(3 + sqrt(33))), (1/4)*(-7 - sqrt(33)))]
    @test_int [1/sqrt(3 + 2*x^2 - 2*x^4), x, 2, EllipticF(asin(sqrt(2/(1 + sqrt(7)))*x), (1/3)*(-4 - sqrt(7)))/sqrt(-1 + sqrt(7))]
    @test_int [1/sqrt(3 + 1*x^2 - 2*x^4), x, 2, EllipticF(asin(sqrt(2/3)*x), -3/2)/sqrt(2)]
    @test_int [1/sqrt(3 + 0*x^2 - 2*x^4), x, 1, EllipticF(asin((2/3)^(1/4)*x), -1)/6^(1/4)]
    @test_int [1/sqrt(3 - 1*x^2 - 2*x^4), x, 2, EllipticF(asin(x), -2/3)/sqrt(3)]
    @test_int [1/sqrt(3 - 2*x^2 - 2*x^4), x, 2, EllipticF(asin(sqrt(2/(-1 + sqrt(7)))*x), (1/3)*(-4 + sqrt(7)))/sqrt(1 + sqrt(7))]
    @test_int [1/sqrt(3 - 3*x^2 - 2*x^4), x, 2, sqrt(2/(3 + sqrt(33)))*EllipticF(asin((2*x)/sqrt(-3 + sqrt(33))), (1/4)*(-7 + sqrt(33)))]
    @test_int [1/sqrt(3 - 4*x^2 - 2*x^4), x, 2, EllipticF(asin(sqrt(2/(-2 + sqrt(10)))*x), (1/3)*(-7 + 2*sqrt(10)))/sqrt(2 + sqrt(10))]
    @test_int [1/sqrt(3 - 5*x^2 - 2*x^4), x, 2, EllipticF(asin(sqrt(2)*x), -1/6)/sqrt(6)]
    @test_int [1/sqrt(3 - 6*x^2 - 2*x^4), x, 2, sqrt((1/6)*(-3 + sqrt(15)))*EllipticF(asin(sqrt((1/3)*(3 + sqrt(15)))*x), -4 + sqrt(15))]
    @test_int [1/sqrt(3 - 7*x^2 - 2*x^4), x, 2, sqrt(2/(7 + sqrt(73)))*EllipticF(asin((2*x)/sqrt(-7 + sqrt(73))), (1/12)*(-61 + 7*sqrt(73)))]


    @test_int [1/sqrt(-2 + 5*x^2 + 3*x^4), x, 1, (sqrt(2 + x^2)*sqrt(-1 + 3*x^2)*EllipticF(asin((sqrt(7/2)*x)/sqrt(-1 + 3*x^2)), 6/7))/(sqrt(7)*sqrt(-2 + 5*x^2 + 3*x^4))]
    @test_int [1/sqrt(-2 + 4*x^2 + 3*x^4), x, 1, (sqrt((2 - (2 - sqrt(10))*x^2)/(2 - (2 + sqrt(10))*x^2))*sqrt(-2 + (2 + sqrt(10))*x^2)*EllipticF(asin((2^(3/4)*5^(1/4)*x)/sqrt(-2 + (2 + sqrt(10))*x^2)), (1/10)*(5 + sqrt(10))))/(2*10^(1/4)*sqrt(1/(2 - (2 + sqrt(10))*x^2))*sqrt(-2 + 4*x^2 + 3*x^4))]
    @test_int [1/sqrt(-2 + 3*x^2 + 3*x^4), x, 1, (sqrt((4 - (3 - sqrt(33))*x^2)/(4 - (3 + sqrt(33))*x^2))*sqrt(-4 + (3 + sqrt(33))*x^2)*EllipticF(asin((sqrt(2)*33^(1/4)*x)/sqrt(-4 + (3 + sqrt(33))*x^2)), (1/22)*(11 + sqrt(33))))/(2*sqrt(2)*33^(1/4)*sqrt(1/(4 - (3 + sqrt(33))*x^2))*sqrt(-2 + 3*x^2 + 3*x^4))]
    @test_int [1/sqrt(-2 + 2*x^2 + 3*x^4), x, 1, (sqrt((2 - (1 - sqrt(7))*x^2)/(2 - (1 + sqrt(7))*x^2))*sqrt(-2 + (1 + sqrt(7))*x^2)*EllipticF(asin((sqrt(2)*7^(1/4)*x)/sqrt(-2 + (1 + sqrt(7))*x^2)), (1/14)*(7 + sqrt(7))))/(2*7^(1/4)*sqrt(1/(2 - (1 + sqrt(7))*x^2))*sqrt(-2 + 2*x^2 + 3*x^4))]
    @test_int [1/sqrt(-2 + 1*x^2 + 3*x^4), x, 1, (sqrt(1 + x^2)*sqrt(-2 + 3*x^2)*EllipticF(asin((sqrt(5)*x)/sqrt(-2 + 3*x^2)), 3/5))/(sqrt(5)*sqrt(-2 + x^2 + 3*x^4))]
    @test_int [1/sqrt(-2 + 0*x^2 + 3*x^4), x, 1, (sqrt(-2 + sqrt(6)*x^2)*sqrt((2 + sqrt(6)*x^2)/(2 - sqrt(6)*x^2))*EllipticF(asin((2^(3/4)*3^(1/4)*x)/sqrt(-2 + sqrt(6)*x^2)), 1/2))/(2*6^(1/4)*sqrt(1/(2 - sqrt(6)*x^2))*sqrt(-2 + 3*x^4))]
    @test_int [1/sqrt(-2 - 1*x^2 + 3*x^4), x, 1, (sqrt(-1 + x^2)*sqrt(2 + 3*x^2)*EllipticF(asin((sqrt(5/2)*x)/sqrt(-1 + x^2)), 2/5))/(sqrt(5)*sqrt(-2 - x^2 + 3*x^4))]
    @test_int [1/sqrt(-2 - 2*x^2 + 3*x^4), x, 1, (sqrt(-2 - (1 - sqrt(7))*x^2)*sqrt((2 + (1 + sqrt(7))*x^2)/(2 + (1 - sqrt(7))*x^2))*EllipticF(asin((sqrt(2)*7^(1/4)*x)/sqrt(-2 - (1 - sqrt(7))*x^2)), (1/14)*(7 - sqrt(7))))/(2*7^(1/4)*sqrt(1/(2 + (1 - sqrt(7))*x^2))*sqrt(-2 - 2*x^2 + 3*x^4))]
    @test_int [1/sqrt(-2 - 3*x^2 + 3*x^4), x, 1, (sqrt(-4 - (3 - sqrt(33))*x^2)*sqrt((4 + (3 + sqrt(33))*x^2)/(4 + (3 - sqrt(33))*x^2))*EllipticF(asin((sqrt(2)*33^(1/4)*x)/sqrt(-4 - (3 - sqrt(33))*x^2)), (1/22)*(11 - sqrt(33))))/(2*sqrt(2)*33^(1/4)*sqrt(1/(4 + (3 - sqrt(33))*x^2))*sqrt(-2 - 3*x^2 + 3*x^4))]
    @test_int [1/sqrt(-2 - 4*x^2 + 3*x^4), x, 1, (sqrt(-2 - (2 - sqrt(10))*x^2)*sqrt((2 + (2 + sqrt(10))*x^2)/(2 + (2 - sqrt(10))*x^2))*EllipticF(asin((2^(3/4)*5^(1/4)*x)/sqrt(-2 - (2 - sqrt(10))*x^2)), (1/10)*(5 - sqrt(10))))/(2*10^(1/4)*sqrt(1/(2 + (2 - sqrt(10))*x^2))*sqrt(-2 - 4*x^2 + 3*x^4))]
    @test_int [1/sqrt(-2 - 5*x^2 + 3*x^4), x, 1, (sqrt(-2 + x^2)*sqrt(1 + 3*x^2)*EllipticF(asin((sqrt(7)*x)/sqrt(-2 + x^2)), 1/7))/(sqrt(7)*sqrt(-2 - 5*x^2 + 3*x^4))]


    @test_int [1/sqrt(-3 + 7*x^2 + 2*x^4), x, 1, (sqrt((6 - (7 - sqrt(73))*x^2)/(6 - (7 + sqrt(73))*x^2))*sqrt(-6 + (7 + sqrt(73))*x^2)*EllipticF(asin((sqrt(2)*73^(1/4)*x)/sqrt(-6 + (7 + sqrt(73))*x^2)), (1/146)*(73 + 7*sqrt(73))))/(2*sqrt(3)*73^(1/4)*sqrt(1/(6 - (7 + sqrt(73))*x^2))*sqrt(-3 + 7*x^2 + 2*x^4))]
    @test_int [1/sqrt(-3 + 6*x^2 + 2*x^4), x, 1, (sqrt((3 - (3 - sqrt(15))*x^2)/(3 - (3 + sqrt(15))*x^2))*sqrt(-3 + (3 + sqrt(15))*x^2)*EllipticF(asin((sqrt(2)*15^(1/4)*x)/sqrt(-3 + (3 + sqrt(15))*x^2)), (1/10)*(5 + sqrt(15))))/(sqrt(2)*3^(3/4)*5^(1/4)*sqrt(1/(3 - (3 + sqrt(15))*x^2))*sqrt(-3 + 6*x^2 + 2*x^4))]
    @test_int [1/sqrt(-3 + 5*x^2 + 2*x^4), x, 1, (sqrt(3 + x^2)*sqrt(-1 + 2*x^2)*EllipticF(asin((sqrt(7/3)*x)/sqrt(-1 + 2*x^2)), 6/7))/(sqrt(7)*sqrt(-3 + 5*x^2 + 2*x^4))]
    @test_int [1/sqrt(-3 + 4*x^2 + 2*x^4), x, 1, (sqrt((3 - (2 - sqrt(10))*x^2)/(3 - (2 + sqrt(10))*x^2))*sqrt(-3 + (2 + sqrt(10))*x^2)*EllipticF(asin((2^(3/4)*5^(1/4)*x)/sqrt(-3 + (2 + sqrt(10))*x^2)), (1/10)*(5 + sqrt(10))))/(2^(3/4)*sqrt(3)*5^(1/4)*sqrt(1/(3 - (2 + sqrt(10))*x^2))*sqrt(-3 + 4*x^2 + 2*x^4))]
    @test_int [1/sqrt(-3 + 3*x^2 + 2*x^4), x, 1, (sqrt((6 - (3 - sqrt(33))*x^2)/(6 - (3 + sqrt(33))*x^2))*sqrt(-6 + (3 + sqrt(33))*x^2)*EllipticF(asin((sqrt(2)*33^(1/4)*x)/sqrt(-6 + (3 + sqrt(33))*x^2)), (1/22)*(11 + sqrt(33))))/(2*3^(3/4)*11^(1/4)*sqrt(1/(6 - (3 + sqrt(33))*x^2))*sqrt(-3 + 3*x^2 + 2*x^4))]
    @test_int [1/sqrt(-3 + 2*x^2 + 2*x^4), x, 1, (sqrt((3 - (1 - sqrt(7))*x^2)/(3 - (1 + sqrt(7))*x^2))*sqrt(-3 + (1 + sqrt(7))*x^2)*EllipticF(asin((sqrt(2)*7^(1/4)*x)/sqrt(-3 + (1 + sqrt(7))*x^2)), (1/14)*(7 + sqrt(7))))/(sqrt(6)*7^(1/4)*sqrt(1/(3 - (1 + sqrt(7))*x^2))*sqrt(-3 + 2*x^2 + 2*x^4))]
    @test_int [1/sqrt(-3 + 1*x^2 + 2*x^4), x, 1, (sqrt(-1 + x^2)*sqrt(3 + 2*x^2)*EllipticF(asin((sqrt(5/3)*x)/sqrt(-1 + x^2)), 3/5))/(sqrt(5)*sqrt(-3 + x^2 + 2*x^4))]
    @test_int [1/sqrt(-3 + 0*x^2 + 2*x^4), x, 1, (sqrt(-3 + sqrt(6)*x^2)*sqrt((3 + sqrt(6)*x^2)/(3 - sqrt(6)*x^2))*EllipticF(asin((2^(3/4)*3^(1/4)*x)/sqrt(-3 + sqrt(6)*x^2)), 1/2))/(6^(3/4)*sqrt(1/(3 - sqrt(6)*x^2))*sqrt(-3 + 2*x^4))]
    @test_int [1/sqrt(-3 - 1*x^2 + 2*x^4), x, 1, (sqrt(1 + x^2)*sqrt(-3 + 2*x^2)*EllipticF(asin((sqrt(5)*x)/sqrt(-3 + 2*x^2)), 2/5))/(sqrt(5)*sqrt(-3 - x^2 + 2*x^4))]
    @test_int [1/sqrt(-3 - 2*x^2 + 2*x^4), x, 1, (sqrt(-3 - (1 - sqrt(7))*x^2)*sqrt((3 + (1 + sqrt(7))*x^2)/(3 + (1 - sqrt(7))*x^2))*EllipticF(asin((sqrt(2)*7^(1/4)*x)/sqrt(-3 - (1 - sqrt(7))*x^2)), (1/14)*(7 - sqrt(7))))/(sqrt(6)*7^(1/4)*sqrt(1/(3 + (1 - sqrt(7))*x^2))*sqrt(-3 - 2*x^2 + 2*x^4))]
    @test_int [1/sqrt(-3 - 3*x^2 + 2*x^4), x, 1, (sqrt(-6 - (3 - sqrt(33))*x^2)*sqrt((6 + (3 + sqrt(33))*x^2)/(6 + (3 - sqrt(33))*x^2))*EllipticF(asin((sqrt(2)*33^(1/4)*x)/sqrt(-6 - (3 - sqrt(33))*x^2)), (1/22)*(11 - sqrt(33))))/(2*3^(3/4)*11^(1/4)*sqrt(1/(6 + (3 - sqrt(33))*x^2))*sqrt(-3 - 3*x^2 + 2*x^4))]
